import './App.css';



const App = () => {
  const Mensaje = () => {
    return <h1>Hola Mundo</h1>
  }

  const Description = () => {
    return <p>Esta es la app del curso fullstack bootcamp</p>

  }

  return (
    <div className="App">
     <Mensaje />
     <Mensaje />
     <Mensaje />
     <Description />
    </div>
  );
}

export default App;
